import styled from "styled-components";
export const SectionTabsWrapper = styled.div`
  display: flex;
  .item {
    min-width: 120px;
    height: 48px;
    line-height: 48px;
    border: solid 0.5px #d8d8d8;
    border-radius:3px;
    ${(props) => props.theme.mixin.boxShadow}
  }
`;
